import './App.css';
import { Routes, Route, Li} from "react-router-dom"
import UserReg from './components/userRegistration/UserReg';

function App() {
  return (
    <>
      <Routes>
        <Route exact path='/' element={<UserReg />} />
      </Routes>
    </>
  );
}

export default App;
